import React, { useState } from 'react';
import './App.css';
import Card from './Card';

const sampleArray = [
  'aaa', 'bbb', 'ccc', 'ddd', 'eee'
]

function App() {

  return (
    <div>
      {sampleArray.map((data) => {
        return (
          <Card name={data} date='2020/07/18' />
        )
      })}
    </div>
  )

}

export default App
